import React, { useState, useEffect } from 'react'
import './styles.css'
import '../App.css'
import Footer from '../Components/Footer'

function Bookings() {
    const [appointments, setAppointments] = useState([])

    useEffect(() => {
      fetch('http://localhost:3001/api/bookings', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify({
            token: localStorage.getItem('token')
          })
        })
      .then(data => data.json())
      .then(data => setAppointments(data))
      .then(data => console.log(data))
    //    .then(data => data.error ? window.location = '/register' : console.log(data))
      }, [])

    return (
        <div className="card">
            <div className="authBox">
                {appointments ? appointments.map((appointment) => (
                  <div key={appointment.id}>
                    <h4>{appointment.date.parse}</h4>
                    <p>You have a <b>{appointment.service}</b> appointment at <b>{appointment.userAddress}</b></p>
                    <p>We will call <b>{appointment.userPhone}</b> 15 minutes prior to arrival.</p>
                  </div>
                )
                  ) : ''}
            </div>
            <Footer />
        </div>
    )
}

export default Bookings
